export default function Education() {
  const educationData = [
    {
      degree: "Bachelor of Science in Computer Science",
      institution: "Mulund College of Commerce (Autonomous)",
      year: "2025 – Graduated",
      grade: "CGPA: 9.8"
    },
    {
      degree: "Higher Secondary Education (XII)",
      institution: "Satish Pradhan Dnyanasadhana College",
      year: "2022",
      grade: "Percentage: 66%"
    }
  ];

  return (
    <section id="education" className="py-16 bg-slate-50">
      <div className="container mx-auto px-4 md:px-8">
        <h2 className="text-3xl font-bold text-center mb-12">Education</h2>
        
        <div className="max-w-3xl mx-auto">
          {educationData.map((edu, index) => (
            <div key={index} className="bg-white rounded-lg shadow-md p-6 mb-6 relative border-l-4 border-blue-600">
              <h3 className="text-xl font-semibold mb-2">{edu.degree}</h3>
              <p className="text-slate-600 mb-1">{edu.institution}</p>
              <p className="text-slate-500 mb-3">{edu.year}</p>
              <div className="bg-blue-50 text-blue-800 font-medium px-3 py-1 rounded inline-block">
                {edu.grade}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
